import React, { Component } from 'react'

export class DisplayPanel extends Component {
    constructor(props){
        super(props);
    }


  render() {
    return (
        <>
        {/* {this.onDataChange()} */}
      <div>DisplayPanel</div>
      <p>data displaying</p>
      {
        this.props.data.map(result=>(
          <>
            <p>{result}</p>
          </>
        ))
      }
      </>
    )
  }
}

export default DisplayPanel
